import React from "react";
import './navbar.css';

import { Navbar, Nav, Container } from "react-bootstrap";
import { LinkContainer } from "react-router-bootstrap";
import { Link } from "react-router-dom";

const NavBar = () => {
  return (
<header id="header" className="d-flex align-items-center">
  <div className="container d-flex align-items-center justify-content-between">
    <h1 className="logo"><a href="">BLOG <span>.</span></a></h1>
    <nav id="navbar" className="navbar">
      <ul>
        <li><LinkContainer to="/"><a className="nav-link scrollto active">Home</a></LinkContainer></li>
        <li><LinkContainer to="/about"><a className="nav-link scrollto">About Us</a></LinkContainer></li>
        <li><LinkContainer to="/blog"><a className="nav-link scrollto">Our Blog</a></LinkContainer></li>
        <li><LinkContainer to="/contact"><a className="nav-link scrollto">Contact</a></LinkContainer></li>
        <Link to={`/details/${post.id}`}>
          <button>More Details</button>
        </Link>
      </ul>
      <i className="bi bi-list mobile-nav-toggle" />
    </nav>
  </div>
</header>
  );
};

export default NavBar;
